    e.preventDefault()

      const apiUrl = await fetch(`https://cors-anywhere.herokuapp.com/https://www.googleapis.com/youtube/v3/search?part=id&q=123&type=video&maxResults=1&key=${api_key}`)
      const data = await apiUrl.json()
      console.log(data)

